import React from "react";
import {Link} from "react-router-dom";

class Navbar extends React.Component{
  render() {
    return(
      <div>
        <nav>
          <ul className="right">

            <li><Link to={`/all-stats`} className="">ALL STATS</Link></li>
          </ul>
        </nav>
      </div>
    )
  }
}
export  default Navbar;
